import React, { Component } from 'react';

class Stories extends Component {
  render() {
    return (
      <div className="containter">
        <header>
          <p>
	    this is my webpage
          </p>
          <a
            href="https://reactjs.org"
            target="_blank"
            rel="noopener noreferrer"
          >
            Learn React
          </a>
        </header>
      </div>
    );
  }
}

export default Stories;
